import Axios from './caller.services'


let getAllstuff= ()=>{
	return Axios.get('/api/stuff')
}

let getStuff=(id)=>{
	return Axios.get('/api/stuff/'+id)
}

let modifyThing=(Thing)=>{
	return Axios.put('/api/stuff/'+id)
}
export const stuffService = {
	getAllstuff,
	getStuff,
	modifyThing
}
